export class Confirm extends Component {
  continue = e => {
    e.preventDefault();
    // PROCESS FORM //
    this.props.nextStep();
  };

  back = e => {
    e.preventDefault();
    this.props.prevStep();
  };

  render() {
   
    return (
        <div><div><a className="p8">Sampleâ€™s Report</a></div>
        <div className="space1"><a className="p3">Do you want to record your sample data?</a></div>
        <div className="btnlist2">
          <Button className="button8" onClick={this.back}>Cancel</Button>
          <Button className="button9"  onClick={this.continue} >Start</Button>
        </div></div>
      
    );
  }
}

export default Confirm;
